		class CDefaultStyle :public CStyle
		{
		private:
			void DataToImage(APP_COLOR *data, const size_t width, const size_t height, APP_IMAGE &image);
		public:
			CDefaultStyle();
		};

		static CDefaultStyle *DefaultStyle{ nullptr };

		CStyle *GetDefaultStyle()
		{
			if (!DefaultStyle)
				DefaultStyle = new CDefaultStyle();
			return DefaultStyle;
		}

		void CDefaultStyle::DataToImage(APP_COLOR *data, const size_t width, const size_t height, APP_IMAGE &image)
		{
			image.Alloc(width, height);
			size_t x, y;
			for (y = 0; y < height; y++)
				for (x = 0; x < width; x++)
					image[x][y] = data[y * width + x];
		}

